import React from "react";
function Reister() {
  const [state, setState] = React.useState({
    name: "",
    email: "",
    password: "",
    country:"",
    city:"",
    street:"",
    number:"",
    apt:""
  });
  const handleChange = evt => {
    const value = evt.target.value;
    setState({
      ...state,
      [evt.target.name]: value
    });
  };

  const handleOnSubmit = evt => {
    evt.preventDefault();

    const { name, email, password } = state;
    alert(
      `You are sign up with name: ${name} email: ${email} and password: ${password}`
    );

    for (const key in state) {
      setState({
        ...state,
        [key]: ""
      });
    }
  };

  return (
    <div className="form-container sign-up-container">
      <form onSubmit={handleOnSubmit}>
        <h1>Create Account</h1>
        <input
          type="text"
          name="full name"
          value={state.name}
          onChange={handleChange}
          placeholder="Name"
        />
        <input
          type="email"
          name="email"
          value={state.email}
          onChange={handleChange}
          placeholder="Email"
        />
        <input
          type="password"
          name="password"
          value={state.password}
          onChange={handleChange}
          placeholder="Password"
        />
        <input
          type="text"
          name="country"
          value={state.country}
          onChange={handleChange}
          placeholder="country"
          />
        <input
          type="text"
          name="city"
          value={state.city}
          onChange={handleChange}
          placeholder="city"
          />
        <input
          type="street"
          name="street"
          value={state.street}
          onChange={handleChange}
          placeholder="street"
        />
        <input
          type="text"
          name="number"
          value={state.number}
          onChange={handleChange}
          placeholder="appartment number"
        />
        <input
          type="number"
          name="apt"
          value={state.apt}
          onChange={handleChange}
          placeholder="apt"
        />
        <button>Sign Up</button>
      </form>
    </div>
  );
}

export default Reister;
